import React, { Component } from 'react'

class EventBind extends Component {
    constructor(props) {
      super(props)
    
      this.state = {
         message: "Hello const"
      }
    }
  render() {
    return (
      <div>
        <div>{this.state.message}</div>
        <button>Click</button>
      </div>
    )
  }
}

export default EventBind
